import { FETCH_RENTALS } from "../actions/types";

const initialState = {
  rentals: [
    // {
    //   id: 1,
    //   title: "testing"
    // }
  ]
};
export const rentals = (state = initialState, action) => {
  switch (action.type) {
    case FETCH_RENTALS:
      return { ...state, rentals: action.rentals };
    default:
      return state;
  }
};
